webpackJsonp([0xc62cc54b1175],{4376:function(t,a){t.exports={data:{markdownRemark:{html:'<h2>B Tag</h2>\n<p>The <code>&#x3C;b></code> tag is used to specify bold text, without conveying any special importance or relevance. When bolding text of special importance or relevance, it is recommended that you use the <code>&#x3C;strong></code> tag. </p>\n<h3>Example:</h3>\n<div class="gatsby-highlight">\n      <pre class="language-html"><code><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>b</span><span class="token punctuation">></span></span>This text is bold<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>b</span><span class="token punctuation">></span></span>\n</code></pre>\n      </div>\n<p>This would appear as:</p>\n<p><strong>This text is bold</strong></p>\n<h4>More Information:</h4>\n<!-- Please add any articles you think might be helpful to read before writing the article -->\n<ol>\n<li><a href="https://www.w3schools.com/tags/tag_b.asp" title="<b> Tag: w3schools">w3schools</a> <br /></li>\n<li><a href="https://developer.mozilla.org/en-US/docs/Web/HTML/Element/b">MDN</a></li>\n</ol>',fields:{slug:"/html/elements/b-tag/"},frontmatter:{title:"B Tag"}}},pathContext:{slug:"/html/elements/b-tag/"}}}});
